import Todo from './components/Todo';
import Modal from './components/Modal';
import Backdrop from './components/Backdrop';

function App() {
  return (<div>
    <h1>My Todos</h1>
    <Todo text='Learn React'/>
    <Todo text='More React'/>
    <Todo text='React to this'/>
    <Modal />
    <Backdrop />
  </div>);
}

export default App;
